import { makeStyles, createMuiTheme, responsiveFontSizes, ThemeProvider } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import React, { Component } from "react";
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { init } from 'ityped'

import 'fontsource-roboto';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

let theme = createMuiTheme();
theme = responsiveFontSizes(theme);

class Typing extends Component {
  componentDidMount() {
    const myElement = document.querySelector("#myElement");
    init(myElement, {
      showCursor: false,
      strings: ["Student", "Developer", "Musician", "Friend"]
    });
  }
  render() {
    return <div id="myElement"></div>;
  }
}

function Intro() {

  const classes = useStyles();

  return (
    <>
      <ThemeProvider theme={theme}>
        <Typography variant="h2">Brenden Smith</Typography>
      </ThemeProvider>
      <Typing/>
    </>
  )
}

function Profile() {

  const classes = useStyles();

  return (
    <>
      {/* <Paper className={classes.paper}>Profile</Paper> */}
      <Avatar className={classes.paper} alt="Brenden Smith" src="/assets/img/profile.jpg" padding=""/>
      <Grid container direction="row" justify="center" align="center" spacing={1}>
        <Grid item>
          <Avatar/>
        </Grid>
        <Grid item>
          <Avatar/>
        </Grid>
        <Grid item>
          <Avatar/>
        </Grid>
        <Grid item>
          <Avatar/>
        </Grid>
        <Grid item>
          <Avatar/>
        </Grid>
      </Grid>
    </>
  )
}

function App() {
  const classes = useStyles();

  return (
    <div container className={classes.root}>
      <Grid container spacing={3} align="center" justify="center" style={{
        position: 'absolute', left: '50%', top: '50%',
        transform: 'translate(-50%, -50%)'
    }}>
        <Grid item xs={3}>
          <Profile/>
        </Grid>
        <Grid item xs={9} align="center" justify="center">
          <Intro/>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
